import React from 'react';
import Slider from 'infinite-react-carousel';
import Pourquoi from './Pourquoi';
import EtAvant from './EtAvant';
import CeQueJaime from './CeQueJaime';

const CvSlider = () => (
  <Slider dots>
    <div>
      <Pourquoi/>
    </div>
    <div>
      <EtAvant/>
    </div>
    <div>
      <CeQueJaime/>
    </div>
    <div>
      <h3>4</h3>
    </div>
    <div>
      <h3>5</h3>
    </div>
  </Slider>
);

export default CvSlider;
